import numpy as np
import matplotlib.pyplot as plt
import seaborn as sns
from sklearn.metrics.pairwise import cosine_similarity
from scipy.cluster.hierarchy import linkage, dendrogram

# 示例DNA长序列
dna_sequence = ""

# 切割DNA序列为128bp片段
def split_dna_sequence(sequence, segment_length=128):
    return [sequence[i:i+segment_length] for i in range(0, len(sequence) - segment_length + 1, segment_length)]

segments = split_dna_sequence(dna_sequence)

# 简单的embedding方法
def simple_dna_embedding(segment):
    embedding = []
    for nucleotide in segment:
        if nucleotide == 'A':
            embedding.append([1, 0, 0, 0])
        elif nucleotide == 'C':
            embedding.append([0, 1, 0, 0])
        elif nucleotide == 'G':
            embedding.append([0, 0, 1, 0])
        elif nucleotide == 'T':
            embedding.append([0, 0, 0, 1])
    return np.mean(embedding, axis=0)

embeddings = np.array([simple_dna_embedding(seg) for seg in segments])

# 计算相似度矩阵
similarity_matrix = cosine_similarity(embeddings)

# 设置阈值
threshold = 0.99
thresholded_matrix = np.where(similarity_matrix >= threshold, similarity_matrix, 0)

# 使用层次聚类重新排列片段顺序
linkage_matrix = linkage(embeddings, method='average')
dendro = dendrogram(linkage_matrix, no_plot=True)
ordered_thresholded_matrix = thresholded_matrix[dendro['leaves'], :][:, dendro['leaves']]

# 绘制热力图，调整颜色映射范围
plt.figure(figsize=(12, 10))
sns.heatmap(ordered_thresholded_matrix, cmap='viridis', annot=False, vmin=0, vmax=1, square=True)
plt.title('Clustered and Thresholded Similarity Matrix Heatmap')
plt.xlabel('Segment Index')
plt.ylabel('Segment Index')
plt.show()